import React, { useEffect, useState } from "react";
import axios from "axios";

function AgentLists({ token }) {
  const [agents, setAgents] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchAgents = async () => {
      try {
        const res = await axios.get("http://localhost:5000/api/agents", {
          headers: { Authorization: `Bearer ${token}` },
        });

        if (res.status === 200) {
          setAgents(res.data);
        } else {
          setError("Failed to fetch agents");
        }
      } catch (err) {
        console.error(err);
        if (err.response) {
          setError(err.response.data.message || "Failed to fetch agents");
        } else {
          setError("Network error or server is down");
        }
      } finally {
        setLoading(false);
      }
    };

    fetchAgents();
  }, [token]);

  if (loading)
    return <p style={{ textAlign: "center", marginTop: "20px" }}>Loading...</p>;

  if (error)
    return (
      <p style={{ color: "red", textAlign: "center", marginTop: "20px" }}>
        {error}
      </p>
    );

  return (
    <div className="agent-lists-container" style={{ maxWidth: "800px", margin: "20px auto" }}>
      <h2 style={{ textAlign: "center", marginBottom: "20px" }}>All Agents</h2>
      {agents.length === 0 ? (
        <p style={{ textAlign: "center" }}>No agents found.</p>
      ) : (
        <table style={{ width: "100%", borderCollapse: "collapse" }}>
          <thead>
            <tr>
              <th style={{ border: "1px solid #ccc", padding: "8px" }}>#</th>
              <th style={{ border: "1px solid #ccc", padding: "8px" }}>Name</th>
              <th style={{ border: "1px solid #ccc", padding: "8px" }}>Email</th>
              <th style={{ border: "1px solid #ccc", padding: "8px" }}>Phone</th>
            </tr>
          </thead>
          <tbody>
            {agents.map((agent, index) => (
              <tr key={agent._id || index}>
                <td style={{ border: "1px solid #ccc", padding: "8px" }}>{index + 1}</td>
                <td style={{ border: "1px solid #ccc", padding: "8px" }}>{agent.name}</td>
                <td style={{ border: "1px solid #ccc", padding: "8px" }}>{agent.email}</td>
                <td style={{ border: "1px solid #ccc", padding: "8px" }}>{agent.phone || "-"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default AgentLists;
